import { useState, useEffect } from 'react';

function App() {

  const [receta, setReceta] = useState([])

  useEffect(() => {
    fetch("https://www.themealdb.com/api/json/v1/1/random.php")
      .then((response)=>response.json())
      .then((receta) => {
        setReceta(receta)
      })
  }, []);

  return (
    <div>
      {console.log(receta.meals[0].strMeal)}
    </div>
  );
}
export default App;
